import 'package:ieca_mobile/enums/_import.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/portugues/_import.dart';

class HymnsConsecration{
  static List<HymnsContent> list = [
    HymnsContent(id: 858, position: 1, content: "Cristo, bom Mestre,\nEis meu querer:\nTua vontade sempre fazer;\nFaze-me forte p'ra resistir\nÀs duras provas que possam vir.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_203, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 859, position: 2, content: "Cristo, bom Mestre,\nEis meu querer:\nMais santidade na vida ter.\nFaze-me firme,\nCristo, meu Deus,\nP'ra não deixar a senda dos céus.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_203, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 860, position: 3, content: "Cristo, bom Mestre,\nEis meu querer:\nTodas as minhas faltas vencer;\nDá-me coragem\nPara lutar,\nPara a vitória sempre ganhar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_203, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 861, position: 1, content: "Ó meu querido Salvador,\nNuvem nenhum terreal\nMe tire a luz celestial.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 862, position: 2, content: "Quando eu do leito despertar\nTua presença quero achar;\nAo dar começo ao meu labor\nSê Tu meu Guia e Protector.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 863, position: 3, content: "Vem conceder-me Teu poder;\nSó podereis assim vencer\nAs seduções do tentador;\nFica comigo, Salvador.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_204, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 864, position: 1, content: "Ó Pai, não tenho poder de mim,\nSenão o Teu poder.\nTudo que pensas ó Pai de mim,\nQue seja sim, feito.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_205, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 865, position: 2, content: "Eu me consagro a Ti Senhor,\nO mundo renuncio.\nSomente em Ti eu esperarei,\nFarei o que Te apraz.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_205, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 866, position: 3, content: "Não duvidarei, do meu Deus;\nSomente n'Ele crer.\nTudo fugaz, não me convém;\nSomente o teu querer.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_205, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 867, position: 1, content: "Dá-me, ó meu Deus, um coração\nLimpo de todo o mal,\nCheio de amor e gratidão\nE graça divinal.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 868, position: 2, content: "Um coração a transbordar\nDe amor por meu Jesus,\nPronto em Seus passos sempre a andar\nLevando a minha cruz.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 869, position: 3, content: "Tu podes dar-me, ó Senhor,\nUm novo coração,\nQue possa amar o pecador,\nLevar-Lhe o Teu perdão.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 870, position: 4, content: "Vem dar-me agora o Teu poder,\nEspírito de Deus.\nMostra-me em tudo o Teu querer,\nAté eu entrar nos céus.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_206, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 871, position: 1, content: "Tu compraste-me ó Jesus,\nCom o sofrimento atroz.\nEu me consagrando a Ti,\nNos cravos das Tuas mãos.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 872, position: 2, content: "Todo o meu ser a Ti;\nCom humildade oferto assim.\nTodo o mal eu vou deixar;\nTomo já a Tua cruz.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 873, position: 3, content: "Se desprezo eu ganhar,\nE preciosos bens perder.\nÓ Jesus, Te seguirei\n`Té que a vida terminar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 874, position: 4, content: "Dá-me corajosa fé;\nPara nunca recear.\nTorne-me um paciente servo,\n`Té que a glória alcansar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_207, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 875, position: 1, content: "Tempo p'ra ser santo\nTu deves tomar,\nViver com teu Mestre,\nSeu livro estudar,\nAndar com seu povo,\nE aos fracos valer,\nEm tudo e por tudo\nSua bênção obter.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 876, position: 2, content: "Tempo p'ra ser puro\nTu deves achar,\nA sós, sempre orando,\nCom Cristo ficar,\nTeus olhos bem fitos em\nDeus sempre ter,\nPela tua conduta provar\nSeu poder.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 877, position: 3, content: "Tempo p'ra ser forte\nTu deves buscar,\nO Mestre seguindo\nPor onde guiar;\nNo gozo ou tristeza\nSempre obedecer,\nAos seus bons conselhos\nSempre recorrer.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 878, position: 4, content: "Tempo p'ra ser útil\nTu deves guardar,\nCalmo e resignado\nEm qualquer lugar;\nCheio da Sua graça,\nRepleto de amor,\nContente e submisso\nAos pés do Senhor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_208, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 879, position: 1, content: "Sou forasteiro aqui,\nEm terra estranha estou;\nDo reino lá do Céu\nEmbaixador eu sou.\nMeu Rei e Salvador\nVos manda em seu amor\nAs boas-novas de perdão.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_209, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 880, content: "Eis a mensagem que me deu\nAquele que por nós morreu:\n«Reconciliai-vos já»,\nÉ ordem que Ele dá;\n«Reconciliai-vos já com Deus»!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_209, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 881, position: 2, content: "É ordem do meu Rei\nQue todo o pecador,\nArrependido já,\nConfesse ao Salvador\nTodo o pecado seu,\nPois Ele prometeu\nDar o perdão por seu amor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_209, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 882, position: 3, content: "No meu eterno lar\nNão há perturbação;\nEterno gozo e paz\nOs salvos fruirão!\nE quem obedecer\nA Cristo, vai viver\nNo reino eterno do meu Rei.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_209, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 883, position: 1, content: "Ó companheiros, é digno,\nDeixar que só Jesus\nCarregue o madeiro?\nOnde estão os seus fiéis?", hymnsNumber: HymnsNumberSeeder.CONSECRATION_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 884, position: 2, content: "Ó companheiros, avante;\nVejamos o seu sofrer.\nLevantai também o madeiro,\nCom Ele caminhar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 885, position: 3, content: "Carrego já a minha cruz,\nMesmo com tentações.\nSeja o que fôr e o que vier,\nEle é exemplo para mim.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 886, position: 4, content: "Ó Cristo, fortifica-nos,\nP'ra nunca desistir.\nAté entrarmos na glória,\nNo lar do nosso Deus.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_210, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 887, position: 1, content: "Oh! meu Senhor,\nEu quero ser mui puro,\nEu quero ser também,\nMeu Deus, veraz.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_211, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 888, content: "Pois, muitos há,\nSenhor, que me contemplam,\nSim, meu Senhor,\nQue olham para mim,\nSim, meu Senhor,\nQue olham para mim!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_211, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 889, position: 2, content: "Oh! quero ser\nMui forte e destemido,\nSim, quero ser humilde,\nManso e bom.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_211, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 890, position: 3, content: "Oh! meu Senhor,\nEu quero cada dia,\nÀ Tua Lei divina obedecer.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_211, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 891, position: 1, content: "Ó Deus, Te digne que Te exaltemos\nCom o trabalho dia após dia,\nDas nossas mãos como do coração,\nSeja todo ele por Ti exaltado.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 892, position: 2, content: "Todo negócio aos Teus olhos sê recto;\nTodo egoísmo, seja afastado.\nPurificando, nossos corações,\nDando-nos força para trabalhar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 893, position: 3, content: "De todo o mal afaste-nos Senhor,\nP’ra Te adorarmos com fé e amor.\nTua alegria sirva-nos de prémio,\nDa nossa fé e nossas orações.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 894, position: 4, content: "Bens desta vida abençoe Senhor,\nTanto os de casa como os do cultivo,\nP'ra Te louvarmos nosso Criador,\nDa ceifa áurea p’ra Te bendizer.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_212, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 895, position: 1, content: "Jesus, sempre te amo,\nPorque sei que és meu;\nA Ti toda a honra\nE louvores dou eu.\nMeu Mestre divino,\nMeu Amo, meu Rei.\nA Ti, ó meu Cristo,\nMe submeterei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_213, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 896, position: 2, content: "Eu Te amo porque\nTu morreste por mim;\nEu Te amo porque\nTeu amor não tem fim.\nEm Ti confiança\nP'ra sempre terei;\nA Ti, ó meu Cristo,\nMe submeterei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_213, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 897, position: 3, content: "Eu Te amo na vida,\nNa morte também.\nSempre hei-de louvar-te\nNa glória de além.\nAgora e p'ra sempre\nPor Ti viverei;\nA Ti, ó meu Cristo,\nMe submeterei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_213, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 898, position: 1, content: "Meu irmão, procura ser\nIgual a Daniel!\nResoluto em combater\nO usurpador cruel!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_214, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 899, content: "Faze como Daniel!\nServe o eterno Deus;\nEntre os infiéis, fiel,\nMarcha para os céus!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_214, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 900, position: 2, content: "Em coragem singular,\nLeal sê tu ao Rei!\nSempre ousado em proclamar\nJesus e sua lei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_214, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 901, position: 3, content: "Fortalece o coração.\nE deixa a timidez!\nMuitos males cairão\nPerante a intrepidez!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_214, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 902, position: 1, content: "Da Tua morte meu Senhor,\nSempre me lembrarei;\nTeu sacrifício remidor\nJamais esquecerei.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 903, content: "Quero lembrar da Tua dor\nLá no calvário, ó Salvador;\nQuero lembrar do Teu amor,\nDa Tua cruz, Senhor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 904, position: 2, content: "Quero lembrar que no jardim,\nCristo meu Salvador,\nAgonizaste Tu por mim,\nSofrendo intenso horror.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 905, position: 3, content: "Quero lembrar a amarga cruz,\nDe dor e humilhação,\nOnde fizeste meu Jesus,\nPor mim a expiação.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 906, position: 4, content: "Do dia alegre, triunfal,\nEm que, da morte além,\nSaíste em glória divinal,\nQuero lembrar também.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 907, position: 5, content: "Dia após dia levarei\nA minha cruz Senhor,\nSempre de Ti me lembrarei\nCom gratidão e amor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_215, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 908, position: 1, content: "Vem ensinar-nos, ó Fonte da vida,\nP'ra espandir-mos o Santo Evangelho.\nEnsina-nos também as Novas dos céus,\nP'ra resgatarmos os homens do mal.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 909, position: 2, content: "Vem dirigir-nos, p'ra darmos o exemplo,\nPara os perversos deixarem o mal.\nTu que nossa alma alimentas, e nutres,\nP'ra alimentarmos a todos famintos.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 910, position: 3, content: "Vem dar-nos vida, ó Fonte de vida.\nDá-nos a força e o coração puro.\nPara salvarmos com graça e paciência,\nAos que se encontram na vil tentação.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 911, position: 4, content: "Vem encaminhar-nos no santo labor.\nSeja onde for, Senhor vem mandar-nos;\nDepois na glória imensa do Céu\nLouvar-te-emos alegres, sem fim.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_216, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 912, position: 1, content: "Sopro Divino, vem\nMinha alma bafejar,\nPara que eu possa amar-Te, ó Deus,\nE em tudo te agradar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 913, position: 2, content: "Sopro Divino, vem\nMeu coração manter\nSujeito a ti, Senhor, meu Rei,\nSubmisso ao Teu querer.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 914, position: 3, content: "Sopro Divino, vem\nFaze-me todo Teu,\nAté que o brilho eu possa ter\nDa luz que vem do céu.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 915, position: 4, content: "Sopro Divino, vem,\nInsufla dentro de mim\nEterna vida, e poderei\nNo céu viver sem fim.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_217, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 916, position: 1, content: "Crentes, não há descansar;\nNo perigo alerta estai.\nEsforçai-vos sem cessar.\nVigiai. Orai.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 917, position: 2, content: "Grande turba infernal\nContra vós altiva sai,\nProcurando o vosso mal.\nVigiai. Orai.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 918, position: 3, content: "Em vós nunca confieis;\nArmas divinais tomai,\nSó desta arte vencereis.\nVigiai. Orai.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 919, position: 4, content: "Muitos reinam já em paz;\nSeu exemplo contemplai.\nVence tudo a fé audaz.\nVigiai. Orai.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 920, position: 5, content: "Fala-vos o Salvador;\nSeus conselhos escutai.\nTerno e sábio é Seu amor.\nVigiai. Orai.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_218, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 921, position: 1, content: "Teu bom conselho tenho,\nP’ra Te seguir Ó Cristo.\nCom força divina ajude e fortaleça,\nP’ra que zeloso eu viva.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 922, position: 2, content: "Teu bom conselho tenho,\nNão praticar o mal,\nVirtude ao meu coração Jesus aumente,\nTua testemunha, eu seja.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 923, position: 3, content: "Teu bom conselho tenho,\nDe auxiliar aos outros,\nJesus que eu seja de paz e compaixão\nE coração tocado.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 924, position: 4, content: "Teu bom conselho tenho,\nDe Tua luz pregar.\nJesus lá do céu, inflama a minha mente,\nFaz que eles cream Teu nome.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 925, position: 5, content: "Teu bom conselho tenho,\nDa Cruz levar comigo.\nJesus, faz-me manso e plenamente crente,\nE alegremente seguir-Te.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_219, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 926, position: 1, content: "Meu Senhor, sou Teu; Tua voz ouvi.\nA chamar-me com amor.\nMas de Ti mais perto eu almejo estar,\nÓ bendito Salvador!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_220, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 927, content: "Mais perto da Tua cruz\nQuero estar, ó Salvador!\nMais perto da Tua cruz\nLeva-me, ó meu Senhor!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_220, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 928, position: 2, content: "A seguir-te só me consagro já,\nConstrangido pelo amor;\nE meu coração bem contente está\nEm servir-te a Ti, Senhor!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_220, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 929, position: 3, content: "Oh, que pura e santa delícia é\nAos Teus santos pés me achar,\nE com viva e reverente fé\nCom meu Salvador falar!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_220, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 930, position: 1, content: "Visão de um mundo a agonizar\nEstá perante nós,\nOuvimos frágil o seu pulsar\nE sua débil voz:\nSenhor Jesus, vem reavivar\nA tua Igreja aquí;\nQue ela saiba hoje usar\nPoder que vem de Ti.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 931, position: 2, content: "O deus de pedra do pagão\nNão o livra do temor.\nOs homens sentem solidão\nEm meio do esplendor;\nSenhor Jesus vem despertar\nTua Igreja para ver;\nEm derredor faze-a vibrar\nDe amor por todo o ser.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 932, position: 3, content: "Agora quando a compreensão\nEstá a aumentar;\nDifunde presto na nação,\nTeu ensino salutar.\nSenhor Jesus, dá-nos vigor\nP'ra sempre anunciar,\nAs boas novas de amor,\nSim, em qualquer lugar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 933, position: 4, content: "O julgamento ameaça vir,\nPor cima surge a cruz;\nAo derredor a sucumbir\nEstão almas sem a luz!\nSenhor Jesus vem constranger\nTeu povo a ver assim,\nQue proclamar é seu dever,\nA começar por mim.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_221, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 934, position: 1, content: "Dedico a oferta ao meu Deus,\nCom um puro coração.\nPor mais singela ela for,\nMister é a Oferta dar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 935, position: 2, content: "Ele mil bênçãos já nos deu,\nDevemos dar também,\nA sua graça imensa é,\nÉ digno de louvor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 936, position: 3, content: "Também receba o nosso ser,\nÓ nosso justo Deus;\nP'ra vermos Tua glória além,\nEternamente.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 937, position: 4, content: "Ó criaturas graças dai,\nGratos, gratos a Deus.\nPor tudo que na terra sois,\nMercê a Sua grei. Ámen.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_222, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 938, position: 1, content: "Tudo, ó Cristo, a Ti entrego;\nTudo, sim, por Ti darei!\nResoluto, mas submisso,\nSempre, sempre, seguirei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 939, position: 2, content: "Tudo entregarei!\nTudo entregarei!\nSim, por ti, Jesus bendito,\nTudo deixarei!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 940, position: 3, content: "Tudo, ó Cristo, a Ti entrego,\nCorpo e alma, eis aqui!\nEste mundo mau renego,\nÓ Jesus, me aceita a mim!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 941, position: 4, content: "Tudo, ó Cristo, a Ti entrego,\nQuero ser somente teu!\nTão submisso à tua vontade,\nComo os anjos lá no Céu!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 942, position: 5, content: "Tudo, ó Cristo, a Ti entrego;\nOh! eu sinto teu amor\nTransformar a minha vida\nE meu coração Senhor!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 943, position: 6, content: "Tudo, ó Cristo, a Ti entrego;\nOh! que gozo, meu Senhor!\nPaz perfeita, paz completa!\nGlória, glória ao Salvador!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_223, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 944, position: 1, content: "Tudo entregarei a Cristo,\nToda a minha força e ser;\nMinha inteligência e alma\nTudo entregarei Senhor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_224, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 945, position: 2, content: "Tudo entregarei a Cristo,\nToda a minha força e ser.\nTudo entregarei a Cristo,\nToda a minha vida à Ti.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_224, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 946, position: 3, content: "Dedicar-me ao Seu serviço,\nE seguir os passos seus.\nQue eu veja sempre a Cristo\nCantarei o Seu louvor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_224, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 947, position: 4, content: "Seu olhar a Jesus Cristo,\nEsquecerei o mundo vil.\nContemplando a rude cruz,\nReconheço o Salvador.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_224, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 948, position: 1, content: "Nas Tuas mãos ó Deus,\nTudo entregamos.\nTudo o que temos nós,\nO nosso ser e forças.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_225, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 949, position: 2, content: "Recebe ó nosso bom Jesus,\nRecebe ó nosso amado Deus,\nTudo a Ti nós entregamos.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_225, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 950, position: 3, content: "Tudo vem de Ti, Senhor,\nE o que é Teu nós Te damos.\nNada aqui é nosso, ó Pai,\nTudo isso vem de Ti.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_225, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 951, position: 4, content: "Aceita o que queremos dar,\nE vem dos nossos corações.\nNossa fé, querer, pensar,\nO resto ó Cristo Tu dispões.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_225, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 952, position: 1, content: "Jesus, Senhor, me chego a Ti,\nOh! dá-me alívio mesmo aqui!\nO Teu favor estende a mim,\nAceita um pecador!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 953, position: 2, content: "Eu venho como estou;\nEu venho como estou;\nPorque Jesus por mim morreu?\nEu venho como estou.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_226, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 954, position: 3, content: "As minhas culpas grandes são;\nMas Tu, que não morreste em vão,\nMe podes conceder perdão.\nAceita um pecador!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 955, position: 4, content: "Eu nada posso merecer;\nTu vês-me prestes a morrer;\nJesus, a Ti me vou render;\nAceita um pecador.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 956, position: 5, content: "Sim, venho agora, Redentor;\nSó Tu, Jesus, és meu Senhor;\nOh! Vem salvar-me em Teu amor;\nAceita um pecador!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_226, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 957, position: 1, content: "Ouve! A voz divina chama,\nQuem irá a trabalhar.\nRicos campos nos convidam!\nHoje entremos a ceifar.\nAlto e forte o Mestre chama,\nGalardão te oferta ali.\nQuem responderá, dizendo:\n«Manda-me, estou pronto aqui».", hymnsNumber: HymnsNumberSeeder.CONSECRATION_227, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 958, position: 2, content: "Corre! Aponta aos pecadores,\nO benigno Salvador.\nVai! Conduze os cordeirinhos\nAo regaço do Senhor.\nLeva as almas doloridas\nNovas de consolação.\nVai! Publica a todo o mundo:\n«Em Jesus há salvação.»", hymnsNumber: HymnsNumberSeeder.CONSECRATION_227, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 959, position: 3, content: "Ah! Não digas ocioso:\n«Eu não tenho que fazer.»\nEis os povos que falecem!\nMultidões a perecer!\nOlha o Mestre que suplica,\nOuve a voz chamando ali\nOh, responde sem demora:\n«Manda-me: estou pronto aqui.»", hymnsNumber: HymnsNumberSeeder.CONSECRATION_227, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 960, position: 1, content: "Feliz é o homem que não vai\nConforme os ímpios vão,\nNem com os pecadores tem\nAlguma comunhão.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 961, position: 2, content: "Porém na lei, na santa lei\nDe Deus se alegra bem;\nE posto sempre o coração\nNa lei divina tem.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 962, position: 3, content: "Tal homem florescendo vai\nQual plantação que está\nAo pé de um rio, e fruto bom,\nEm tempo próprio dá.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 963, position: 4, content: "Jamais a sua folha cai,\nNem murcha vem a ser,\nE bem maduro se fará\nO fruto que ele der.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 964, position: 5, content: "Os ímpios não serão assim;\nJamais felizes são;\nPorém parecem com o pó\nQue os ventos levarão.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 965, position: 6, content: "No juízo não subsistirão,\nNo dia do Senhor;\nDos justos longe ficarão,\nCurtindo eterna dor.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_228, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 966, position: 1, content: "Mais vontade dá-me,\nDe odiar o mal,\nMais calma em pesares,\nMais alto ideal,\nMais fé no meu Mestre,\nMais consagração,\nMais gozo em servi-lo,\nMais grata oração.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_229, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 967, position: 2, content: "Mais prudente faz-me,\nMais sábio por Ele,\nMais firme na causa,\nMais forte e leal,\nMais recto na vida,\nMais triste ao pecar,\nMais humilde filho,\nMais pronto em amar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_229, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 968, position: 3, content: "Mais pureza dá-me,\nMais força em Jesus,\nMais do teu domínio,\nMais paz nessa cruz,\nMais rica esperança,\nMais obras aqui,\nMais ânsia do céu,\nMais vida em Ti.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_229, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 969, position: 1, content: "A Samuel Deus falou palavras de favor;\nOh! quanto se admirou ouvindo o Criador!\nQue dita se Jesus assim\nSe dignasse ensinar a mim!", hymnsNumber: HymnsNumberSeeder.CONSECRATION_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 970, position: 2, content: "Não poderia estar com falta de atenção,\nPor medo de pecar de língua ou coração,\nMas sempre havia de exultar\nA ouvir o grande Deus falar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 971, position: 3, content: "Pois na divina lei eu ouço a voz de Deus!\nO santo, eterno Rei, falando-me dos céus;\nCom reverente amor convém\nSaber o que essa lei contém.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 972, position: 4, content: "Eu devo humilde ouvir sua rica instrução,\nE o bom Jesus servir de todo o coração.\nSeu servo, infante mas, fiel,\nComo o menino Samuel.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_230, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 973, position: 1, content: "A voz de Deus nos chama\nA vida e dedicar,\nEm santo e nobre esforço\nSeu reino proclamar.\nHumildes respondamos\n«Rendemos tudo a Ti.\nE prontos para a lida\nEis-nos, Senhor, aqui».", hymnsNumber: HymnsNumberSeeder.CONSECRATION_231, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 974, position: 2, content: "Ao Salvador unidos\nPor viva fé e amor,\nNo Seu poder achamos\nA fonte de vigor.\nE fortes nele, com júbilo.\nNós vamos trabalhar,\nE muitos pecadores\nA Cristo encaminhar.", hymnsNumber: HymnsNumberSeeder.CONSECRATION_231, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 975, position: 3, content: "Se em nosso testemunho\nSeguirmos a Jesus,\nA nossa vida pura\nDerramará a luz.\n«Senhor, por Teu Espírito,\nEm nós vem residir,\nE sempre o Teu desejo\nEm todos nós cumprir».", hymnsNumber: HymnsNumberSeeder.CONSECRATION_231, typeStanza: HymnsContentCode.VERSE),

  ];
}